import React from 'react';

function Header() {
  return (
    <header style={{ display: 'flex', alignItems: 'center', padding: '1rem' }}>
      <img src="img/logo.jpg" alt="My Website Logo" style={{ height: '60px' }} />
      <div className="header-info" style={{ marginLeft: '1rem' }}>
        <h1 style={{ fontSize: '2rem' }}>My Website</h1>
        <p style={{ fontSize: '1rem' }}>Call us: 1-800-123-4567</p>
      </div>
      <nav style={{ marginLeft: 'auto' }}>
        <ul style={{ display: 'flex', listStyle: 'none' }}>
          <li style={{ marginRight: '1rem' }}><a href="#">Home</a></li>
          <li style={{ marginRight: '1rem' }}><a href="#">About</a></li>
          <li><a href="#">Contact</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
